class TargetTcpProxyProxyHeader(str, Enum):
    """
    Specifies the type of proxy header to append before sending data to the backend, either NONE or PROXY_V1. The default is NONE.
    """
    NONE = "NONE"
    PROXY_V1 = "PROXY_V1"
